            <div className="cardHeader">
                <span>About Us</span>


            </div>
            <div className="profileImage">
                <img src="https://i.pinimg.com/originals/cd/a2/08/cda2081dfd2b1af5c0444a032294965c.png" alt=""/>
            </div>
        </Card>

        <Card>
            <div className="cardHeader">
                <span>Social Network</span>

            </div>
        </Card>
        </div>


    )
}

export default Sidebar;
